import { MultiSelect } from "react-multi-select-component";
import { useState } from "react";

const options = [
    { label: "Gewerbe", value: "Gewerbe" },
    { label: "Kaderkonferenz alle", value: "Kaderkonferenz alle" },
    { label: "Koordinationssitzung", value: "Koordinationssitzung"},
  ];
  
  const Drive = (props) => {
    const [selectedDrive, setSelectedDrive] = useState([]);
  
    return (
      <div>
        <MultiSelect
          options={options}
          value={selectedDrive}
          onChange={setSelectedDrive}
        />
      </div>      
    );
  };
  
export default Drive;
